import React from 'react';
import { connect } from 'react-redux';

class VideoItem extends React.Component {
  constructor(props) {
    super();
  }
  render() {
    const video = this.props.video;
    return (
      <div>Video Item</div>
    );
  }

}

export default connect(null)(VideoItem);
